import { Link } from 'react-router-dom';
import './NavBar.css'; 

const NavBar = () => {
  return (
    <nav className="navbar">
      <Link to="/">Inicio</Link>
      <Link to="/pokemons">Pok√©mon</Link>
      <Link to="/team">Crea tu equipo</Link>
    </nav>
  );
};

export default NavBar;
